import React from 'react'
import { Link } from 'react-router-dom'
import './../Css/SideNav.css'

function SideButtons({icon,text,path}) {
  return (
    <div>
        <Link to={path} type="submit" class="btn btn-primary my-4 p-1 navbutton" >
            <div class="row">
                <div class="col-2">
                    {icon}
                </div>
                <div class="col-10">
                    {text}
                </div>
            
        
            </div>

        </Link>
    </div>
  )
}

export default SideButtons
